(17,36,64,1,'Business Card Magnets','1020080','<header><h2>Applications</h2></header><h2>Create Custom Size Magnets for Your Business Cards</h2>\r\n<br>Magnets are the all-time favorite refrigerator dcor. It is not only for aesthetic purposes nowadays but also used to stick important a reminder such as grocery lists and notes. But have you also considered using card magnets to display your business information? A card magnet can be a marketing godsend, just think of how many times your target market might open the refrigerator door in a single day. Aside from this, you can also use it as giveaways, gifts and even calendars.<header><h2>Technical</h2></header><div>\r\n<div>Here at UPrinting, our business card magnets are available in both standard and custom sizes. These magnets are printed on 17 pt. card stock that sticks to any metal surface and are UV coated. Order quantity is from 25  5000 that are ready to be shipped in 4 or 6 business days depending on your choice.</div>\r\n<br>For more questions about business card magnet printing, just call us at 1-888-888-4211. You can also choose to chat with us via out Live Chat button. We are more than willing to assist you on all your printing needs!</div>',5.00,'storage/art_uploads/15561642950.jpg'),
(18,37,3,1,'Brochure Printing','1020004','<header><h2>Overview</h2></header><h2>Let Brochure Printing Strengthen Your Business</h2>\r\n<p>Brochure printing is part of every successful marketing campaign. Give away brochures at a convention, highlight details about your new collection, or include them with every new customer purchase. They are an effective, versatile, and affordable promotional tool.</p>\r\n<p>You need a fold that complements your brand and brochure design. Choose from our 10 available brochure folding formats.</p>\r\n<p></p>\r\n<h3>2-Panel Folds</h3>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Half Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Bifold_Brochures.png\" alt=\"Bifold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Bi-Fold</strong><br> As its name indicates, this brochure contains two panels with enough space for lengthy text or large images.</div>\r\n</div>\r\n<h3>3-Panel Folds</h3>\r\n<p>Choose from the following three-panel folding options: the trifold or letter fold, the z-fold, and the gate fold.</p>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Trifold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Trifold_Brochures.png\" alt=\"Trifold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Trifold</strong><br> The trifold is folded twice to create three panels for a short, visual, and informative brochure.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Z-Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Z-Fold_Brochures.png\" alt=\"Z-fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Z-Fold</strong><br> This commonly used brochure has six printed pages on both sides.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Gate Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Gate_Fold_Brochures.png\" alt=\"Gate Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Gate Fold</strong><br> The gate fold works best on brochure designs with a central image or several visual elements.</div>\r\n</div>\r\n<h3>4-Panel Folds</h3>\r\n<p>We offer five four-panel folding options:</p>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"ccordion Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Accordion_Fold_Brochures.png\" alt=\"Accordion Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Accordion Fold</strong><br> This brochure fold forms a zig zag pattern.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Double Gate Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Double_Gate_Fold_Brochures.png\" alt=\"Double Gate Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Double Gate Fold</strong><br> This fold is similar to the gate fold, but has two extra panels.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Double Parallel Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Double_Parallel_Fold_Brochures.png\" alt=\"Double Parallel Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Double Parallel</strong><br> This fold is folded equally in half then folded again in the same direction.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"French Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/French_Fold_Brochures.png\" alt=\"French Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>French Fold</strong><br> The French fold is folded in half horizontally and then vertically folded in half to create the four equally sized panels.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Roll Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Roll_Fold_Brochures.png\" alt=\"French Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Roll Fold</strong><br> Roll fold is folded three times from right to left. Each panel is directed to fold toward the left.</div>\r\n</div>\r\n<p>We print brochures for you on three premium paper coating options. Glossy paper is vibrant, while the mattes smooth surface is elegantly subdued. All brochures printed on paper stock and 10 pt. cardstock are folded before printing.</p>\r\n<p>You can upload a ready-made design or create your own brochure with our design tool. Make a new design today and have the order shipped anywhere in the US. Start brochure printing for your marketing needs today.</p>\r\n<h2>Q&A</h2>\r\n<p><strong>Are the sizes shown folded or unfolded?</strong></p>\r\n<p>All sizes shown on the calculator measure the brochure when unfolded and laid out flat on a surface. This means that if you want a finished trifold brochure that folds to 9.5 x 3.69, the unfolded size would be 9.5 x 11.</p>\r\n<p><strong>What should be inside my brochure?</strong></p>\r\n<p>1. <strong>Cover</strong> - A central image that immediately conveys what your product or service has to offer. Include your company logo and name so customers make the association.</p>\r\n<p>2. <strong>High Resolution Images </strong>- Use 350 dpi resolution images on your brochure design. This resolution ensures the photo wont be blurry upon printing.</p>\r\n<p>3. <strong>Features and Benefits</strong> - The copy should elaborate on the main selling points of your product or service. Break it down in a list format or several sections for easy reading.</p>\r\n<p>3. <strong>Call to Action</strong> - Include discount coupons or promos in the brochure to drive traffic to your store or online e-commerce site.</p>\r\n<p>5. <strong>Contact Information</strong> - Dont forget to place all your companys contact information, such as a telephone number, address, email address, and website for the customers reference.</p>\r\n<p><strong>How much copy and images should I include on my brochure?</strong></p>\r\n<p>The most eye-catching brochures are highly visual and use images to guide the reader through the content. A photo or illustration in each panel helps introduce or show the content in detail. Copy should be as short as possible and sustain the readers focus on your main topic. For more information, check out our guide on<a href=\"https://www.uprinting.com/blog/how-to-design-brochure/\">how to design brochures</a>.</p>\r\n<p><strong>What does the number in the paper material name indicate?</strong></p>\r\n<p>The number before the paper and cardstock material indicates its weight. This means that 70 lb. paper is the thinnest and lightest, while 100 lb. is the thickest among the paper options. The 10 pt. cardstock is also lightweight but still slightly thicker than the paper stock materials.</p>',5.00,'storage/art_uploads/15561662420.png'),
(19,38,64,1,'Business Card Magnets','1020080','<header><h2>Applications</h2></header><h2>Create Custom Size Magnets for Your Business Cards</h2>\r\n<br>Magnets are the all-time favorite refrigerator dcor. It is not only for aesthetic purposes nowadays but also used to stick important a reminder such as grocery lists and notes. But have you also considered using card magnets to display your business information? A card magnet can be a marketing godsend, just think of how many times your target market might open the refrigerator door in a single day. Aside from this, you can also use it as giveaways, gifts and even calendars.<header><h2>Technical</h2></header><div>\r\n<div>Here at UPrinting, our business card magnets are available in both standard and custom sizes. These magnets are printed on 17 pt. card stock that sticks to any metal surface and are UV coated. Order quantity is from 25  5000 that are ready to be shipped in 4 or 6 business days depending on your choice.</div>\r\n<br>For more questions about business card magnet printing, just call us at 1-888-888-4211. You can also choose to chat with us via out Live Chat button. We are more than willing to assist you on all your printing needs!</div>',5.00,'storage/art_uploads/15561665540.jpg'),
(20,39,11,1,'Rounded Corner Flyers','1020016','<header><h2>Overview</h2></header><h2>Rounded Corner Flyers: a Subtle Yet Sublime Difference</h2>\r\n<p>Over-the-top and funky-looking die-cuts grab attention, but they aren\'t right for all brands. Rounded-corner flyers are the perfect shape for brands that need to stand out a bit more, but can\'t go with unconventional shapes.</p>\r\n<p>With our exclusive die-cut shapes, any business can create the perfect flyer. Whether you\'re using them for one-off events, or for long campaigns, as handouts, mailed, or bundled with other printing, these flyers will make a difference. Use them by themselves or as part of a suite of marketing materials for any brand. Rounded-corner flyers come standard as 4\" x 6\".</p>\r\n<p>We offer an assortment of stocks for our flyers from standard 14 pt., to heavier 16 pt., with gloss, matter, uncoated, and UV finishes. What\'s more, you can <a href=\"https://www.uprinting.com/samples.html\">order samples</a> so you can see for yourself which stocks would make the best match for your designs.</p>\r\n<p>For more custom options for die-cut flyers, call us at 888-888-4211.</p>',5.00,'storage/art_uploads/15561667440.png'),
(21,40,1,5,'Bulk Booklets','1020002','<header><h2>Applications</h2></header><h2>Save Money by Ordering in Bulk</h2>\r\n<p style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" dir=\"ltr\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Bulk Booklets are a creative and professional way of presenting your product and services. These are also used to promote offers, provide list of services, or give information about your company. Moreover, these are ideal for CD and DVD cover booklets on launches. Each page of your booklet can help you gain more customers.</span></p>\r\n<p><strong id=\"docs-internal-guid-eb7ba602-2c3c-44c5-017b-8eb89cec6ec2\" style=\"font-weight: normal;\"><br></strong></p>\r\n<p style=\"line-height: 1.38; margin-top: 0pt; margin-bottom: 0pt;\" dir=\"ltr\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;\">Here at UPrinting, our booklet printing service can produce 250-25,000 copies. It is available in either custom or standard sizes. We assure you that our wide range of sizes will match your preferred design and layout. Just use the product calculator to change your preferred paper type, cover paper, pages, and binding options. Turnaround time is 4 or 6 days depending on your choice.</span></p>\r\n<p><br><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">Create your design and leave the professional online printing on us! Call us at 1-888-888-4211. If you have queries and questions, you can chat with us through our </span><a style=\"text-decoration-line: none;\" href=\"https://www.uprinting.com/live-chat-request\"><span style=\"font-size: 11pt; font-family: Arial; color: #000000; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; text-decoration-line: underline; vertical-align: baseline; white-space: pre-wrap;\">Live Chat</span></a><span style=\"font-size: 11pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;\">. We are more than willing to assist you!</span></p>',5.00,'storage/art_uploads/15569027980.jpg'),
(22,40,35,10,'Standard Postcards','1020048','<header><h2>Overview</h2></header><h2>Promote Big Events With High-Quality Standard Postcard Printing</h2>\r\n<p>Effective marketing need not consume your entire budget and take up a lot of time. Standard postcard printing is an affordable way of informing current and potential customers on your brands latest deals, promos, or products. Its impact begins in the homes of your consumers when they receive their postcard in the mail.</p>\r\n<p>Promotional postcards compel them to check out what youre announcing and visit your store to check out the advertised offer.</p>\r\n<h2>What Are the Advantages of Each Paper Material?</h2>\r\n<p>We offer several cardstock and coating options that protect your postcard design from damage during mailing or on display.</p>\r\n<h3>10 pt. Cardstock</h3>\r\n<ul>\r\n<li style=\"list-style: disc;\">The lightest and most flexible option</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Recommended for handing out in store or at specialized events</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Comes in protective gloss or smooth matte</li>\r\n</ul>\r\n<h3>14 pt. Cardstock</h3>\r\n<ul>\r\n<li style=\"list-style: disc;\">The standard material used for other thick promotional products such as business cards</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Sturdy enough to handle high-quality double-sided printing & multiple handlings</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Available in shiny gloss and elegant matte coating </li>\r\n</ul>\r\n<h3>16 pt. Cardstock</h3>\r\n<ul>\r\n<li style=\"list-style: disc;\">Additional durability gives an upscale feel</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Double-sided gloss protects it from wear, tear, & other external damage</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Matte finish leads customers to reading lengthier text</li>\r\n</ul>\r\n<h3>17 pt. Cardstock</h3>\r\n<ul>\r\n<li style=\"list-style: disc;\">The thickest and most durable material available</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Can withstand multiple handling during delivery to several areas </li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\">Uncoated finish keeps one side writable, making it ideal for travel postcards</li>\r\n</ul>\r\n<h2>Which Is the Best Size for My Postcard Design?</h2>\r\n<p>Its crucial for you to choose dimensions that will make your custom postcards effective and impactful. Here are some of our standard postcard sizes that are guaranteed to make an immediate impression:</p>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>4\" x 6\"</strong> is small enough to make a straightforward and easy to read announcement. Its also easy to keep and qualifies as USPS First-Class mail. </li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>5\" x 7\"</strong> stands out against the smaller, standard postcards sent as personal mail. Its width allows for the right balance among several images and compelling copy. Perfect for promoting a new business or product line.</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>5.5\" x 8.5\"</strong> has more than enough space for an image-heavy or extremely visual design. Recommended for postcards announcing a sale or special deal available in store or under a limited time period. </li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>6\" x 9\"</strong> is the biggest option among the popular postcard sizes. Suitable for postcards with more than three images or the need to relay information in a straightforward, visual manner. </li>\r\n</ul>\r\n<h2>Do You Offer Direct Mailing?</h2>\r\n<p>We save you from the hassle of distributing your postcards yourself with a <a href=\"https://www.uprinting.com/mailing-service.html\" target=\"_blank\">direct mail service</a> which only adds 2-3 business days to your turnaround time. No need to worry about stuffing envelopes, addressing each to customers, then making the trip to USPS. We take care of your order every step of the wayfrom when you print standard postcards, sending you a free file check to avoid errors, then delivering each item to your customers doorstep.</p>\r\n<h2>Q&A</h2>\r\n<p><strong>When can I expect to receive my postcard order?</strong></p>\r\n<p>Our online calculator lets you choose a preferred printing turnaround, usually as fast as one business day. Printing turnaround refers to the number of days it takes to produce the postcards. To find out when your postcards will arrive, input your ZIP code after selecting Estimate Shipping Cost and Delivery Date on our online calculator.</p>\r\n<p><strong>Which is the most durable cardstock among the materials available?</strong></p>\r\n<p>The thicker cardstocks are able to withstand the potential damage from the mailing process. The <strong>14 pt. cardstock</strong> is the most popular option, but the <strong>16 pt.</strong> and <strong>17 pt. </strong>have a more substantial weight. We highly recommend the <strong>16 pt. cardstock gloss</strong> for those planning to delivery a large quantity of postcards to several locations.</p>\r\n<p><strong>How do I create an effective postcard design?</strong></p>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>Keep things short and sweet.</strong> People want information thats easy to digest and understand. The copy on your postcard should compel customers to read but not lose their attention. </li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>Call your customers to action.</strong> Give them a reason to visit your store, website, or to try a new product. This action can convert your postcard marketing into significant sales.</li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>Communicate the benefit you have to offer.</strong> Resist the urge to list down product features. Instead, show them that your latest restaurant promotion will save them money (50% off) or how a real estate location can lower their cost of living in the long run. </li>\r\n</ul>\r\n<ul>\r\n<li style=\"list-style: disc;\"><strong>Utilize large images & bright colors</strong>. Your postcard needs to stand out against every other marketing promotion. Make sure the central image is compelling enough to draw attention and that the colors lead the customer right into your headline and contact information<strong>. </strong></li>\r\n</ul>\r\n<p>To find out how else you can utilize custom postcards, check out this <a href=\"https://www.uprinting.com/blog/custom-postcards-design-applications-printing-tips/\" target=\"_blank\">article on designing postcards effectively</a>.</p>\r\n<p><strong>What is the advantage of getting a free file check? <br></strong></p>\r\n<p>Our free file check lets you look at the design before it is sent for printing. This gives you time to make significant changes and ensure that the entire postcard is free of errors.</p>\r\n<p></p>\r\n<br>\r\n<p></p>\r\n<p></p>',5.00,'storage/art_uploads/15569028340.jpg'),
(23,41,2,1,'Short Run Booklets','1020003','<header><h2>Applications</h2></header><h2>Affordable Premium Product Booklets</h2>\r\n<p>Our <strong>short run booklets</strong> are ideal for businesses that would like to provide appealing tools while on a tight budget.  We offer affordable and professional booklet printing services for your commercial purposes.  With our business booklet printing, you can have a set of elegant booklets to give out to your company\'s staff, loyal clients, or potential customers. Get the ideal impression from these people with every well-designed page of your booklet. Let us handle the <a href=\"https://www.uprinting.com/booklet-printing.html\">booklet printing</a> and to get the value that you\'ll pay for.</p><header><h2>Technical</h2></header><p>As a dedicated booklet printing company, we are providing your desired booklet printing specifications to suit your design and layout. Select from our offered booklet size option, cover paper, binding, and pages to personalize your set. You can also create an attractive <em>booklet</em> project by using our booklet template. Order a minimum of 25 booklets or up to 150 copies that would fit your budget. We provide 3 business days for the basic print turnaround time and 2 business days for rush orders.</p>\r\n<p>Choose UPrinting for your short run booklets and pay less for high-quality services.</p>',5.00,'storage/art_uploads/15569033110.png'),
