(26,44,78,20,'Slim Rounded Corner Business Cards','1020094','<header><h2>Applications</h2></header><h2>Slim Business Cards with a Twist</h2>\r\n<p>Slim rounded corner business cards have a unique shape to enhance your branding with their sleek minimalist form. With a good business card layout and a great design, its a real attention-grabber. Since these are smaller than standard business cards, make sure your font style and text size will still be readable. Slim business cards are popular with small businesses, creative professionals, online businesses, and photographers.</p>\r\n<p>These die-cut business cards are printed on a 14 pt. cardstock with a gloss, matte or high gloss coating. Print from 25 to 10,000 cards with a 2, 4, or 6-day printing turnaround. Before paying, you can have your design checked for free to avoid any printing errors such as low resolution images, or any design or text being cut because it extends into the safe zone.</p>',5.00,'storage/art_uploads/15571714670.jpg'),
(27,45,5,2,'Short-Run Catalogs','1020007','<header><h2>Applications</h2></header><h2>Save with Short Run Catalogs</h2>\r\n<p><strong>Short run</strong><a href=\"https://www.uprinting.com/catalog-printing.html\">catalog printing</a> lets you define lower number of copies for your catalogs which is great as giveaways to small offices or for select individuals. It is advisable for printing less than 150 catalog copies giving you a faster turnaround time.</p><header><h2>Technical</h2></header><p>For short run <em>catalog printing</em>, choose between standard sizes, 5.5\" x 8.5\" and 8.5\" x 11\". We use 100 lb. gloss paper stock with pagination ranging from 8 to 40.  For binding options, you can either have them saddle-stitched or choose our sturdier wire-o binding.</p>\r\n<p>For queries about our catalog printing services, launch our live chat or give us a call at 1-888-888-4211.</p>',5.00,'storage/art_uploads/15572450270.png'),
(28,45,79,10,'Circle Business Cards','1020095','<header><h2>Applications</h2></header><h2>Cirle Business Card Printing for a Brand That Stands Out</h2>\r\n<p>Tired of using plain marketing tools to promote your brand? Want to try something new and different? Grab some circle business cards for a change!</p>\r\n<p>Business cards are a classic, and of course popular, way to promote your brand. If you want to stand out from the rest of the competition, try something different. Why not start with some circle business cards? This shape is popular with arts & crafts and food businesses.</p>\r\n<p>Round business cards are stylish and can give your ordinary business cards a fresh look. At UPrinting, you can have circle business cards in a 2.5 diameter printed on a 14 pt. cardstock (Gloss, Matte or High Gloss). Order from 25 to 10,000 pieces in 2, 4, or 6 business days!</p>',5.00,'storage/art_uploads/15572451110.png'),
(29,45,161,4,'Rip Cards','1020200','<header><h2>Overview</h2></header><h2>Use Rip Cards for Upcoming Promotions</h2>\r\n<p>Our rip cards come in a standard size of 3.5\" x 8.5\" and comes with a 2\" perforation measured from the bottom. They are just perfect if youre planning to offer discounts through coupons or give out ticket passes for your companys important events.</p>\r\n<p>With our rip cards printing, you have the option for uncoated, matte, gloss, or high-gloss cardstock. Our 16 pt. cardstock should be thick enough for most uses but we have an uncoated, ultra-thick 17 pt. cardstock if you want to really impress your customers.</p>\r\n<p>Rip cards printed on uncoated card stock are usually writable in most cases (depending on the type of pen used). You can opt for glossy card stock for sheen and vibrant colors. Or use a high-gloss finish for that extra shine. A matte finish is the right option if you want a more muted look.</p>\r\n<p>Printing for rip cards can be ordered as fast as 4 business days, getting your marketing materials to you faster, and your marketing working with customers faster.</p>',5.00,'storage/art_uploads/15572451480.jpg'),
(30,46,3,1,'Brochure Printing','1020004','<header><h2>Overview</h2></header><h2>Let Brochure Printing Strengthen Your Business</h2>\r\n<p>Brochure printing is part of every successful marketing campaign. Give away brochures at a convention, highlight details about your new collection, or include them with every new customer purchase. They are an effective, versatile, and affordable promotional tool.</p>\r\n<p>You need a fold that complements your brand and brochure design. Choose from our 10 available brochure folding formats.</p>\r\n<p></p>\r\n<h3>2-Panel Folds</h3>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Half Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Bifold_Brochures.png\" alt=\"Bifold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Bi-Fold</strong><br> As its name indicates, this brochure contains two panels with enough space for lengthy text or large images.</div>\r\n</div>\r\n<h3>3-Panel Folds</h3>\r\n<p>Choose from the following three-panel folding options: the trifold or letter fold, the z-fold, and the gate fold.</p>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Trifold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Trifold_Brochures.png\" alt=\"Trifold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Trifold</strong><br> The trifold is folded twice to create three panels for a short, visual, and informative brochure.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Z-Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Z-Fold_Brochures.png\" alt=\"Z-fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Z-Fold</strong><br> This commonly used brochure has six printed pages on both sides.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Gate Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Gate_Fold_Brochures.png\" alt=\"Gate Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Gate Fold</strong><br> The gate fold works best on brochure designs with a central image or several visual elements.</div>\r\n</div>\r\n<h3>4-Panel Folds</h3>\r\n<p>We offer five four-panel folding options:</p>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"ccordion Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Accordion_Fold_Brochures.png\" alt=\"Accordion Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Accordion Fold</strong><br> This brochure fold forms a zig zag pattern.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Double Gate Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Double_Gate_Fold_Brochures.png\" alt=\"Double Gate Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Double Gate Fold</strong><br> This fold is similar to the gate fold, but has two extra panels.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Double Parallel Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Double_Parallel_Fold_Brochures.png\" alt=\"Double Parallel Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Double Parallel</strong><br> This fold is folded equally in half then folded again in the same direction.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"French Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/French_Fold_Brochures.png\" alt=\"French Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>French Fold</strong><br> The French fold is folded in half horizontally and then vertically folded in half to create the four equally sized panels.</div>\r\n</div>\r\n<div class=\"row\">\r\n<div class=\"col-sm-3\"><img title=\"Roll Fold Brochure\" src=\"https://static3.uprinting.com/SmsImages/UP/catalog-widget/110625/active/jpeg/Roll_Fold_Brochures.png\" alt=\"French Fold Brochure\" width=\"160\" height=\"160\"></div>\r\n<div class=\"col-sm-9\" style=\"padding-top: 35px;\"><strong>Roll Fold</strong><br> Roll fold is folded three times from right to left. Each panel is directed to fold toward the left.</div>\r\n</div>\r\n<p>We print brochures for you on three premium paper coating options. Glossy paper is vibrant, while the mattes smooth surface is elegantly subdued. All brochures printed on paper stock and 10 pt. cardstock are folded before printing.</p>\r\n<p>You can upload a ready-made design or create your own brochure with our design tool. Make a new design today and have the order shipped anywhere in the US. Start brochure printing for your marketing needs today.</p>\r\n<h2>Q&A</h2>\r\n<p><strong>Are the sizes shown folded or unfolded?</strong></p>\r\n<p>All sizes shown on the calculator measure the brochure when unfolded and laid out flat on a surface. This means that if you want a finished trifold brochure that folds to 9.5 x 3.69, the unfolded size would be 9.5 x 11.</p>\r\n<p><strong>What should be inside my brochure?</strong></p>\r\n<p>1. <strong>Cover</strong> - A central image that immediately conveys what your product or service has to offer. Include your company logo and name so customers make the association.</p>\r\n<p>2. <strong>High Resolution Images </strong>- Use 350 dpi resolution images on your brochure design. This resolution ensures the photo wont be blurry upon printing.</p>\r\n<p>3. <strong>Features and Benefits</strong> - The copy should elaborate on the main selling points of your product or service. Break it down in a list format or several sections for easy reading.</p>\r\n<p>3. <strong>Call to Action</strong> - Include discount coupons or promos in the brochure to drive traffic to your store or online e-commerce site.</p>\r\n<p>5. <strong>Contact Information</strong> - Dont forget to place all your companys contact information, such as a telephone number, address, email address, and website for the customers reference.</p>\r\n<p><strong>How much copy and images should I include on my brochure?</strong></p>\r\n<p>The most eye-catching brochures are highly visual and use images to guide the reader through the content. A photo or illustration in each panel helps introduce or show the content in detail. Copy should be as short as possible and sustain the readers focus on your main topic. For more information, check out our guide on<a href=\"https://www.uprinting.com/blog/how-to-design-brochure/\">how to design brochures</a>.</p>\r\n<p><strong>What does the number in the paper material name indicate?</strong></p>\r\n<p>The number before the paper and cardstock material indicates its weight. This means that 70 lb. paper is the thinnest and lightest, while 100 lb. is the thickest among the paper options. The 10 pt. cardstock is also lightweight but still slightly thicker than the paper stock materials.</p>',5.00,'storage/art_uploads/15573365900.png'),
